import React from 'react';
import Index from './complementos/Index';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Portafolio from './complementos/Portafolio/Portafolio';


function App() {
  return (
    <Router>
    <Switch>

    <Route path="/">
      <Index/>
    </Route>
    <Route path="/Portafolio">
      <Portafolio/>
    </Route>



  </Switch>
</Router>
);

}

export default App;
